    vector<string> generateParenthesis(int n ){
        
        dp[1].insert("()");
        for(int i=2;i<=n;i++){
            set<string> v1,v2,v3;
            
            v1 = dp[i-1];
            for(auto it: v1){
                string tmp = "(" ;

                dp[i].insert(tmp+ it + ")");
            }
            for(int j=1;j<=i/2;j++){
                v2  = dp[j];
                v3 = dp[i-j];
                for(auto it2:v2){
                    for(auto it3:v3){
                        dp[i].insert(it2+it3);
                        dp[i].insert(it3+it2);
                    }
                }
            }

        }

        cout << "{\n";


        // for(auto it: dp){
        //     cout << "{";
        //     for(auto it2: it){
        //         cout << '\"'<< it2 << "\",";
        //     }
        //     cout << "},\n";
        // }
        // cout << "}";

        vector<string> ret;
        for(auto it: dp[n]){
            ret.push_back(it);
        }

        return ret;
    }
